pragma solidity =0.8.1;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract justNft is ERC721,Ownable {

    uint256 public tokenID;
    mapping(address => uint256) public _userId;
    string private _tokenURI;

    constructor(
        string memory name_
    ) ERC721(name_, name_) {
        tokenID = 1;
    }
    //一个人只能mint一次
    function mint() public   {
        require(_userId[msg.sender] == 0,"already minted");
        _mint(msg.sender, tokenID);
        _userId[msg.sender] = tokenID;
        tokenID = tokenID + 1;
    }

    function _afterTokenTransfer(
        address from,
        address to,
        uint256 firstTokenId,
        uint256 batchSize
    ) internal override {
        require(_userId[to] == 0,"already minted");
        _userId[from] = 0;
        _userId[to] = firstTokenId;
    }

    function setTokenURI(string memory tokenURI_) public onlyOwner {
        _tokenURI = tokenURI_;
    }

    function tokenURI(uint256 tokenId) public view override returns (string memory) {
        _requireMinted(tokenId);

        // string memory baseURI = _baseURI();
        return _tokenURI;
    }

}
